        <div style="font-size: 35pt; ">什么值得卖 </div>
        <p>行业“十三五”规划中提出“大力发展货币文化产业”，“以电子商务、微信商务等新兴营销平台为依托，推动总公司、各企业积极搭建货币文化品牌推广平台和产品营销平台，逐步形成电商和传统营销渠道并重的营销网络“。 沈阳造币、上海造币、中钞长城、西钞、南钞等印制企业先后在天猫、京东、微店以及其他电商平台开设店铺或自建贵金属销售网站。 课题组在学习数据爬虫以及NodeJS、MongoDB等新技术的同时，希望借此机会与行业相关运营人员交流数据化分析方法指导决策。|

    <script>
    var body = document.body;
    var bodyStyle = getComputedStyle(body);
    var hm = document.querySelector('.heatmap');
    var heatmap = h337.create({
        container: hm,
        radius: 60
    });
    var trackData = false;
    setInterval(function() {
        trackData = true;
    }, 50);
    var idleTimeout, idleInterval;
    var lastX, lastY;
    var idleCount;

    function startIdle() {
        idleCount = 0;

        function idle() {
            heatmap.addData({
                x: lastX,
                y: lastY
            });
            idleCount++;
            if (idleCount > 10) {
                clearInterval(idleInterval);
            }
        };
        idle();
        idleInterval = setInterval(idle, 1000);
    };
    body.onmousemove = function(ev) {
        if (idleTimeout) clearTimeout(idleTimeout);
        if (idleInterval) clearInterval(idleInterval);
        if (trackData) {
            lastX = ev.pageX;
            lastY = ev.pageY;
            heatmap.addData({
                x: lastX,
                y: lastY
            });
            trackData = false;
        }
        idleTimeout = setTimeout(startIdle, 50);
    };
    </script>
